import React, { useEffect, useState } from 'react';
import { createHousingPreferences } from '../api/ClientService';
import { getClientsByManager } from '../api/ClientService';

const CreateHousingPreferences = ({ managerId }) => {
    const [clients, setClients] = useState([]);
    const [selectedClientId, setSelectedClientId] = useState('');
    const [formData, setFormData] = useState({
        location: '',
        priceMin: '',
        priceMax: '',
        rooms: '',
        area: ''
    });
    const [message, setMessage] = useState('');

    useEffect(() => {
        const fetchClients = async () => {
            try {
                const data = await getClientsByManager(managerId);
                setClients(data);
            } catch (error) {
                console.error('Ошибка при загрузке клиентов:', error);
            }
        };

        fetchClients();
    }, [managerId]);

    const handleClientChange = (e) => {
        setSelectedClientId(e.target.value);
    };

    const handleChange = (e) => {
        setFormData(prev => ({
            ...prev,
            [e.target.name]: e.target.value
        }));
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        if (!selectedClientId) {
            setMessage('Пожалуйста, выберите клиента.');
            return;
        }
        try {
            await createHousingPreferences(selectedClientId, formData);
            setMessage('Предпочтения успешно созданы!');
            // Очистка формы после успешного сохранения
            setFormData({
                minArea: '',
                maxArea: '',
                minPrice: '',
                maxPrice: '',
                roomsCount: '',
                hasBalcony: '',
                allowPets: '',
                additionalNotes:''
            });
        } catch (error) {
            console.error('Ошибка при создании предпочтений:', error);
            setMessage('Ошибка при создании предпочтений');
        }
    };

    return (
        <div className="preferences-container">
            <h2>Создать предпочтения клиента</h2>

            <div className="form-group">
                <label>Выберите клиента:</label>
                <select
                    value={selectedClientId}
                    onChange={handleClientChange}
                    className="form-control"
                >
                    <option value="">-- выберите --</option>
                    {clients.map((client) => (
                        <option key={client.id} value={client.id}>
                            {client.authUser ? `${client.authUser.lastname} ${client.authUser.firstname}` : `Клиент #${client.id}`}
                        </option>
                    ))}
                </select>
            </div>

                <form onSubmit={handleSubmit} className="preferences-form">
                    <div className="form-group">
                        <label>Локация:</label>
                        <input
                            type="text"
                            name="location"
                            value={formData.location}
                            onChange={handleChange}
                            className="form-control"
                        />
                    </div>

                    <div className="form-group">
                        <label>Мин. цена:</label>
                        <input
                            type="number"
                            name="priceMin"
                            value={formData.priceMin}
                            onChange={handleChange}
                            className="form-control"
                            min="0"
                        />
                    </div>

                    <div className="form-group">
                        <label>Макс. цена:</label>
                        <input
                            type="number"
                            name="priceMax"
                            value={formData.priceMax}
                            onChange={handleChange}
                            className="form-control"
                            min={formData.priceMin || "0"}
                        />
                    </div>

                    <div className="form-group">
                        <label>Комнаты:</label>
                        <input
                            type="number"
                            name="rooms"
                            value={formData.rooms}
                            onChange={handleChange}
                            className="form-control"
                            min="1"
                        />
                    </div>

                    <div className="form-group">
                        <label>Площадь (м²):</label>
                        <input
                            type="number"
                            name="area"
                            value={formData.area}
                            onChange={handleChange}
                            className="form-control"
                            min="1"
                        />
                    </div>

                    <button type="submit" className="submit-btn">
                        Сохранить
                    </button>
                </form>

            {message && (
                <div className={`message ${message.includes('Ошибка') ? 'error' : 'success'}`}>
                    {message}
                </div>
            )}
        </div>
    );
};

export default CreateHousingPreferences;
